import React from 'react';
class Header extends React.Component{
	constructor(props){
		super(props);
	}
	render(){
		return(

			<div className="header">
			<div className="logo">mary collins</div>
			<nav className="nav">
				<ul>
				<li>work</li>
				<li>skills</li>
				<li>about</li>
				<li>contact</li>
				</ul>
			</nav>
			</div>
			);
	}
}
export default Header;
